import React from "react";
import styled from "@emotion/styled";

// estilos
const Contenedor = styled.div`
  max-width: 900px
  margin: 0 auto;
    @media (nim-width:992px){
      display:grid;
      grid-template-columns
    }`;
function App() {
  return (
    <h1>Cotizador de Criptomonedas</h1>
  );
}

export default App;
